import * as r from "react";
import c from "../lib/IconBase.es.js";
import e from "../defs/Circuitry.es.js";
const o = r.forwardRef((t, i) => /* @__PURE__ */ r.createElement(c, { ref: i, ...t, weights: e }));
o.displayName = "CircuitryIcon";
const s = o;
export {
  s as Circuitry,
  o as CircuitryIcon
};
